def solve():
    n, q = map(int, input().split())
    painters = [list(map(int, input().split())) for _ in range(q)]

    sections = [0] * (n + 1)
    for l, r in painters:
        sections[l] += 1
        sections[r + 1] -= 1

    prefix_sum = [0] * (n + 1)
    for i in range(1, n + 1):
        prefix_sum[i] = prefix_sum[i - 1] + sections[i]

    max_painted = max(prefix_sum)
    return max_painted - (q - 2)

solve()

