def solve():
    n, q = map(int, input().split())
    painters = []
    for _ in range(q):
        l, r = map(int, input().split())
        painters.append((l, r))

    painters.sort(key=lambda x: x[0])

    best = 0
    for i in range(q):
        for j in range(i + 1, q):
            painted = set()
            for l, r in painters[i:j]:
                for x in range(l, r + 1):
                    painted.add(x)
            best = max(best, len(painted))

    return best

