    from collections import defaultdict

    t = int(input())

    for _ in range(t):
        n, x = map(int, input().split())
        blows = defaultdict(list)

        for _ in range(n):
            d, h = map(int, input().split())
            blows[d].append(h)

        min_blows = float('inf')
        cur_heads = x
        num_blows = 0

        while cur_heads > 0:
            temp_min = float('inf')
            for d, h_list in blows.items():
                for h in h_list:
                    num_blow = (cur_heads + d - 1) // d
                    temp_min = min(temp_min, num_blow)

            if temp_min == float('inf'):
                break

            min_blows = min(min_blows, num_blows + temp_min)
            cur_heads += num_blows * min(blows) - cur_heads
            num_blows += temp_min

        if min_blows == float('inf'):
            print(-1)
        else:
            print(min_blows)

solve()

