def solve():
    time = input().strip()
    hh, mm = map(int, time.split(':'))

    def is_palindrome(h, m):
        return str(h).zfill(2) == str(m).zfill(2)[::-1]

    def to_minutes(h, m):
        return h * 60 + m

    def to_time(minutes):
        return divmod(minutes, 60)

    minutes = to_minutes(hh, mm)
    while not is_palindrome(hh, mm):
        minutes += 1
        hh, mm = to_time(minutes)

    return minutes - to_minutes(int(time[:2]), int(time[3:]))

