    f = [0] * (1 << n)
    for i in range(1 << n):
        if r[i & ((1 << m) - 1)] <= m:
            f[i] = 1

    g = [0] * (1 << n)
    for i in range(1, 1 << n):
        g[i] = f[i & ((1 << m) - 1)] + g[i >> 1]

    ans = 0
    for i in range(1 << n):
        if g[i] == m and (i & 1):
            ans += 1

    print(ans)

