        MOD = 10**9 + 7

        dp = [[[0 for _ in range(1 << n)] for _ in range(T + 1)] for _ in range(4)]
        dp[0][0][0] = 1

        for t in range(1, T + 1):
            for last_genre in range(4):
                for mask in range(1 << n):
                    dp[last_genre][t][mask] = 0

                    for i, song in enumerate(songs):
