def solve():
    import heapq

    N = int(input())
    board = [list(map(int, input().split())) for _ in range(N)]

    moves = [(2, 1), (1, 2), (-2, 1), (2, -1), (-2, -1), (1, -2), (-1, 2), (-1, -2)]
    target = {(i, j): (n // N, n % N) for n in range(1, N**2 + 1) for i in range(N) for j in range(N)}

    def min_steps_count(source, target, piece_moves):
        visited = set()
        pq = [(0, 0, source, None)]
        while pq:
            steps, replacements, pos, piece = heapq.heappop(pq)
            if pos == target:
                return steps, replacements
            if pos in visited:
                continue
            visited.add(pos)
            for move in piece_moves:
                new_pos = (pos[0] + move[0], pos[1] + move[1])
                if 0 <= new_pos[0] < N and 0 <= new_pos[1] < N:
                    new_steps = steps + 1
                    new_replacements = replacements + (piece is not None and piece != board[new_pos[0]][new_pos[1])
                    heapq.heappush(pq, (new_steps, new_replacements, new_pos, board[new_pos[0]][new_pos[1]]))

    start_pos = (0, 0)
    initial_piece = None
    for i in range(N):
        for j in range(N):
            if board[i][j] == 1:
                start_pos = (i, j)
                initial_piece = None
                break

    step_count, replacement_count = min_steps_count(start_pos, target[2], moves)

    print(step_count, replacement_count)


solve()

