def solve():
    import sys
    r, s, p = map(int, sys.stdin.readline().split())

    def dp(rr, ss, pp):
        if rr == 0:
            return 0, 1, 0
        if ss == 0:
            return 1, 0, 0
        if pp == 0:
            return 0, 0, 1

        total = rr * ss + ss * pp + pp * rr
        prob_r = rr * (pp / total)
        prob_s = ss * (rr / total)
        prob_p = pp * (ss / total)

        return prob_r, prob_s, prob_p

    def reduce(r, s, p):
        while r + s + p > 1:
            r, s, p = dp(r, s, p)
        return r, s, p

    r, s, p = reduce(r, s, p)
    print('{:.12f} {:.12f} {:.12f}'.format(r, s, p))

solve()

