def solve():
    n, k = map(int, input().split())
    a = list(map(int, input().split()))
    b = sorted(list(map(int, input().split())))

    zero_indices = [i for i in range(n) if a[i] == 0]
    possibilities = []

    def check_valid(sequence):
        for i in range(1, len(sequence)):
            if sequence[i] <= sequence[i-1]:
                return False
        return True

    def generate_permutations(curr_index, sequence):
        if curr_index == len(zero_indices):
            if not check_valid(sequence):
                possibilities.append(sequence.copy())
            return
        for i in range(k):
            if b[i] not in sequence:
                sequence[zero_indices[curr_index]] = b[i]
                generate_permutations(curr_index + 1, sequence)
                sequence[zero_indices[curr_index]] = 0

    generate_permutations(0, a)

    if possibilities:
        print("Yes")
    else:
        print("No")

solve()

