def solve():
    from heapq import heappush, heappop

    n, f = map(int, input().split())
    days = []

    for _ in range(n):
        k, l = map(int, input().split())
        if k > l:
            days.append((min(2*k, l), min(k, l)))
        else:
            days.append((k, 0))

    total = 0
    heap = []

    for i in range(n):
        total += min(days[i])
        heappush(heap, min(days[i][0] - days[i][1], days[i][0]))

        if i >= f:
            total -= heappop(heap)

    print(total)

