    MOD = 998244353

    def count_trees(vertices: int, parity: int) -> int:
        if vertices == 0:
            return 1 if parity == 0 else 0
        if vertices % 2 == 0:
            return 0
        return count_trees(vertices // 2, 1 - parity) * count_trees(vertices // 2, parity) % MOD

