def solve(n, k, a):
    mod = 10**9 + 7

    def inv(x):
        return pow(x, mod - 2, mod)

    def comb(x, y):
        return (factorial(x) * inv(factorial(y)) * inv(factorial(x - y))) % mod

    n0 = a.count(0)
    n1 = a.count(1)

    if n1 == 0 or n0 == 0:
