from typing import List

def solve(n: int, m: int, s: int, d: int, obstacles: List[int]) -> None:
    def can_reach_finish(m, s, d, obstacles):
        remaining_distance = m
        commands = []

        for obstacle in obstacles:
            if obstacle - remaining_distance <= s:
                return None

            run_distance = min(obstacle - remaining_distance - s, s)
            jump_distance = min(remaining_distance - obstacle, d)

            if run_distance < 1 or jump_distance < 1:
                return None

            commands.append(f"RUN {run_distance}")
            commands.append(f"JUMP {jump_distance}")

            remaining_distance = obstacle + d

        if remaining_distance < m:
            run_distance = min(m - remaining_distance, s)
            commands.append(f"RUN {run_distance}")

        return commands

    result = can_reach_finish(m, s, d, obstacles)
    if result is None:
        print("IMPOSSIBLE")
    else:
        for command in result:
            print(command)

# Example Usage
solve(3, 10, 1, 3, [3, 4, 7])

solve()

