from collections import defaultdict

def solve():
    n, m, k = map(int, input().split())
    special_vertices = list(map(int, input().split()))

    graph = defaultdict(list)
    for _ in range(m):
        u, v, w = map(int, input().split())
        graph[u].append((v, w))
        graph[v].append((u, w))

    max_distance = [0] * (n+1)

    def dfs(node, parent, distance_sofar):
        max_distance[node] = max(max_distance[node], distance_sofar)
        for neighbor, weight in graph[node]:
            if neighbor != parent:
                dfs(neighbor, node, max(distance_sofar, weight))

    for vertex in special_vertices:
        dfs(vertex, 0, 0)

    result = [max(max_distance[x] for x in special_vertices) for _ in range(k)]
    print(*result)

solve()

