def solve(n):
    def count_squares(num):
        count = 0
        for i in range(1, int(sqrt(num)) + 1):
            if num % i == 0:
                count += 2
        if int(sqrt(num)) ** 2 == num:
            count -= 1
        return count

    return count_squares(2 * n)

